 эмоциями, я до сих пор восхищаюсь вашей силой убеждения и умением делиться позитивом! Отдельно говорю спасибо Ольге Сергеевне Пименовой и Виктору Викторовичу Рулеву за блестяще проведенные лапароскопию и гистероскопию. Ольга Сергеевна, ваш настрой на успех и поддержка - дорогого стоят, вы вселяли в меня надежду на каждом визите и старались поддержать, задать правильное направление моим мыслям :-), низкий поклон вам и огромная благодарность за все!!! За чудесные сны во время наркозов благодарю Светлану Анатольевну Мельникову и Людмилу Александровну, отдельное спасибо Людмиле Александровне за физиотерапию и добрые слова, вы относились ко мне как мама! Благодарю Елену Николаевну Сухомлину за блестящие консультации, за умение донести сложные вещи простыми словами, за ваше доброе отношение, как к родному человеку, и умение всегда успокоить и дать заряд положительных эмоций,  для меня беспокойного пациента - это особенно ценно!  Большое спасибо Елене Леонидовне Соболевой, за прекрасный анализ моего дневника питания, за советы и правильный настрой, благодаря вашей поддержке - мои сахара всегда были в норме и фигура осталась прежней, надеюсь, выработанные привычки питания останутся со мной надолго, благодарю вас за профессионализм и грамотные назначения. Огромное спасибо Юрию Леонидовичу Громыко за ведение беременности и ответы даже на самые мои невероятные вопросы, за то, что всегда находили слова, для того, чтобы меня успокоить, за доброе отношение. Спасибо замечательным эмбриологам за золотые руки и знание своего дела, к сожалению, я не знаю точно кто работал с нашим биоматериалом, но уверенна, что все вы являетесь профессионалами с большой буквы. Отдельная благодарность девушкам на ресепшен, которые всегда отзывчиво относились к моим просьбам и организовывали приемы максимально удобно, особенная благодарность Арине. Каждому из Вас желаю крепкого здоровья, благополучия, максимальной отдачи от работы и море благодарных пациентов! Центру - только развития и процветания!";